    }

    &__expand {
      position: relative;
      width: 16px;
      height: 16px;

      &:before,
      &:after {
        content: "";
        position: absolute;
        background-color: #7c7c7c;
        transition: transform 0.4s ease-out 0s;
      }

      &:before {
        top: 0px;
        left: 50%;
        width: 2px;
        height: 16px;
        margin-left: -1px;
      }

      &:after {
        top: 50%;
        left: 0px;
        width: 16px;
        height: 2px;
        margin-top: -1px;
      }

      &--open {
        &:before {
          transform: rotate(90deg);
        }

        &:after {
